import React from "react";
import ReactDOM from "react-dom";

// "props (which stands for propertties). react props are like function arguments in javascript."
function Card() {
  return (
    <div className="cards">

      <div className="card">
        <img src="" alt="myPic" className="card_img" />
        <div className="card_info">
          <span className="card_category"> </span>
          <h3 className="card_title"></h3>
          <a href="https://www.primevideo.com/detail/0LL805LRLJUMK1H89CP0LFLBL5/ref=atv_tv_hom_c_1KkZSf_2_1
" target="_blank">
            <button>Watch Now</button>
          </a>
        </div>
      </div>
    </div>
  )
}

ReactDOM.render(
  <>
    <Card imgsrc="https://wallpapercave.com/wp/wp4507678.jpg"
      title="Amazon Prime Original Series"
      sname="Mr. Robot"


    />
    <Card />
  </>,
  document.getElementById('root')
);

